<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Baby Blob #00000</title>
  <style>
    :root {
      --animate-duration: 1s;
      --animate-delay: 1s;
      --animate-repeat: 1
    }

    .animate__animated {
      animation-duration: 1s;
      animation-duration: var(--animate-duration);
      animation-fill-mode: both
    }

    @keyframes bounce {
      15% {
        transform: translateY(1%) scale(1.1, .9)
      }

      35% {
        animation-timing-function: cubic-bezier(.755, .05, .855, .06);
        transform: translateY(-15%) scale(.9, 1.15)
      }

      55% {
        transform: translateY(0) scale(1.15, .95)
      }

      65% {
        transform: translateY(0) scale(.95, 1.05)
      }

      75% {
        transform: translateY(0) scale(1.025, .975)
      }

      85% {
        transform: translateY(0) scale(.975, 1.025)
      }
    }

    .animate__bounce {
      animation-name: bounce;
      transform-origin: center bottom
    }

    @keyframes rubberBandX {
      0% {
        transform: scaleX(1)
      }

      30% {
        transform: scale3d(1.25, .75, 1)
      }

      40% {
        transform: scale3d(.75, 1.25, 1)
      }

      50% {
        transform: scale3d(1.15, .85, 1)
      }

      65% {
        transform: scale3d(.95, 1.05, 1)
      }

      75% {
        transform: scale3d(1.05, .95, 1)
      }

      to {
        transform: scaleX(1)
      }
    }

    .animate__rubberBandX {
      animation-name: rubberBandX
    }

    @keyframes rubberBandY {
      from {
        transform: scale3d(1, 1, 1)
      }

      30% {
        transform: scale3d(.75, 1.25, 1)
      }

      40% {
        transform: scale3d(1.25, .75, 1)
      }

      50% {
        transform: scale3d(.85, 1.15, 1)
      }

      65% {
        transform: scale3d(1.05, .95, 1)
      }

      75% {
        transform: scale3d(.95, 1.05, 1)
      }

      to {
        transform: scale3d(1, 1, 1)
      }
    }

    .animate__rubberBandY {
      animation-name: rubberBandY
    }

    :root {
      --animate-duration: 1.5s
    }

    #html {
      -webkit-user-drag: none;
      -moz-user-select: none;
      -webkit-user-select: none;
      -ms-user-select: none;
      user-select: none
    }

    #blob {
      display: inline-block;
      width: 100%;
      height: auto
    }

    @media (min-aspect-ratio:1/1) {
      #blob {
        height: 100%;
        width: auto
      }
    }

    body {
      overflow: hidden;
      height: 100vh
    }

    .center {
      display: flex;
      justify-content: center;
      align-items: center
    }
  </style>
</head>
